    data: |
      SELECT DISTINCT + col2 + + col2 + - - col0 / + ( - + col2 ) / 97 * - + ( + 20 ) AS col2 FROM tab0 (FORMAT parquet) WHERE NOT NULL IS NULL;
  - name: tab0

outputs:
  - name: q11250.out
    data: |
